import './App.css';
import './vendors/bootstrap-5.1.3-dist/css/bootstrap.min.css';
import './vendors/bootstrap-5.1.3-dist/bootstrap.min.css';
import './vendors/fontawesome-free-5.15.4-web/css/all.min.css';
import HelloWorld from "./components/HelloWorld";
import Labs from "./components/Labs";
import Tuiter from "./components/Tuiter";
import {BrowserRouter, Route, Switch} from "react-router-dom";



function App() {
  return (

      <BrowserRouter>
          <div className="container">
              <Switch>
              <Route exact path="/hello" component={HelloWorld} />
              </Switch>
              <Switch>
              <Route exactpath="/labs" component={Labs} />
              </Switch>
              <Switch>
              <Route exactpath="/tuiter" component={Tuiter} />
              </Switch>

          </div>
      </BrowserRouter>

  );
}
export default App;
